%%  Robot ABB 1100 4 58
%   Simulación 3: Solución del Robot para una Trayectoria Definida

% Inicialización de la Simulación
clear all; close all; clc;

ABB1100_Parametros

tic

% Parametros de Visualizacion

global sysref zoom xe ye ze alpha beta gamma

sysref = 0;
zoom = 0.5;

% Parametros de Animación
Incremento = 1;
Delay = 0.001;

% Velocidad de simulación
fast = 0.5;

% Puntos de Trayectoria
% Punto    xe      ye          ze       alpha   beta    gamma   Time


Pe =  [ 0.364,   0.000,      0.617,       0,    180,    0,      10*fast;  %P0
        0.312,   0.000,      0.420,       0,    180,    0,      80*fast;   %P1
        0.312,   0.000,      0.380,       0,    180,    0,      40*fast;   %P2
        0.312,   0.000,      0.420,       0,    180,    0,      30*fast;   %P3
        0.557,   -0.04,      0.420,       0,    180,    0,      80*fast;   %P4
        0.557,   -0.04,      0.380,       0,    180,    0,      30*fast;   %P5
        0.312,    0.00,      0.420,       0,    180,    0,      80*fast;   %P6

        0.312,    0.00,      0.420,       0,    180,    0,      30*fast;   %P7
        
        0.312,   0.000,      0.380,       0,    180,    0,      30*fast;   %P11
        0.312,   0.000,      0.420,       0,    180,    0,      30*fast;   %P12
        0.557,   +0.04,      0.420,       0,    180,    0,      80*fast;   %P13
        0.557,   +0.04,      0.380,       0,    180,    0,      30*fast;   %P14
        0.312,    0.00,      0.420,       0,    180,    0,      80*fast;   %P15
        0.312,    0.00,      0.617,       0,    180,    0,      60*fast;
        0.312,    0.00,      0.617,       0,    180,    0,      40*fast];   %P16


X = []; Y = []; Z = []; Alpha = []; Beta = []; Gamma = []; Intervalos = [];

% Formación de Perfil Quíntico

tic

for i = 1:1:length(Pe(:,1))-1

[x1,y1,z1,alphai,betai,gammai,time] = ABB1100_PerfilQuintico(Pe(i:i+1,:));

X = cat(2,X,x1);
Y = cat(2,Y,y1);
Z = cat(2,Z,z1);

Alpha = cat(2,Alpha,alphai);
Beta = cat(2,Beta,betai);
Gamma = cat(2,Gamma,gammai);

Intervalos = cat(2,Intervalos,time);

end

clear alphai betai gammai 

ProfileTime = toc;

% Condición Inicial de Articulaciones (Estado Inicial)
q0 = deg2rad([0,0,0,0,90,0]);

% Avance de Arreglo
cumulative = 1;

prealloc = length(Intervalos);

% Prealocación de Memoria 
x1 = NaN*ones(1,prealloc); y1 = NaN*ones(1,prealloc); z1 = NaN*ones(1,prealloc);
x2 = NaN*ones(1,prealloc); y2 = NaN*ones(1,prealloc); z2 = NaN*ones(1,prealloc);
q1 = NaN*ones(1,prealloc); q2 = NaN*ones(1,prealloc); q3 = NaN*ones(1,prealloc); q4 = NaN*ones(1,prealloc);
q5 = NaN*ones(1,prealloc); q6 = NaN*ones(1,prealloc); Time = NaN*ones(1,prealloc);

%% Simulación Completa

tic

figure(1)
simulacion5 = figure(1);
simulacion5.Position(1:4) = [0 720 1440 720]
simulacion5.Name = "Simulación de Trayectoria Perfil Quintico Robot ABB 1100 4 580"


for i = 1:Incremento:length(X(1,:))
   
    Time(i) = i;

    % Limpieza de Figura
    clf;
    
    % Trayectoria Definida en el Espacio Cartesiano
    xe = X(1,i);
    ye = Y(1,i);
    ze = Z(1,i);

    alpha   = deg2rad(Alpha(1,i));
    beta    = deg2rad(Beta(1,i));
    gamma   = deg2rad(Gamma(1,i));

    if i <= length(X(1,:))/2

        x1(cumulative) = xe;
        y1(cumulative) = ye;
        z1(cumulative) = ze;

    else 
        x2(cumulative) = xe;
        y2(cumulative) = ye;
        z2(cumulative) = ze;
    end

    % Cinemática Inversa
    
    q = fsolve(@ABB1100_CinematicaInversa,q0);
    
    % Almacenamiento de Puntos en el Espacio Articular

    q1(cumulative) = q(1);
    q2(cumulative) = q(2);
    q3(cumulative) = q(3);
    q4(cumulative) = q(4);
    q5(cumulative) = q(5);
    q6(cumulative) = q(6);
    
    % Cálculo del Determinante
    
    DET(cumulative) = -(l2*l3*cos(q(3))*sin(q(5))*(cos(pi) - 1)^2*(l3*cos(q(2) + q(3)) + 2*l2*cos(pi/2 + q(2)) - l3*cos(pi + q(2) + q(3))))/8;
    
    % Cálculo de la velocidad articular 
    xp =  [X(2,i); Y(2,i); Z(2,i); Alpha(2,i); Beta(2,i);Gamma(2,i)];
    xpp = [X(3,i); Y(3,i); Z(3,i); Alpha(3,i); Beta(3,i);Gamma(3,i)];
